parts:
{
  "name": "UBX-NAV-HPPOSECEF",
  "class_id": "0x01",
  "message_id": "0x13",
  "description": "High precision position solution in ECEF",
  "message_type": "periodic_polled",
  "payload_length": {
    "fixed": 28
  },
  "fields": [
    {
      "byte_offset": 0,
      "data_type": "U1",
      "name": "version",
      "description": "Message version (0x00 for this version)",
      "fixed_value": 0
    },
    {
      "byte_offset": 1,
      "data_type": {
        "array_of": "U1",
        "count": 3
      },
      "name": "reserved1",
      "reserved": true
    },
    {
      "byte_offset": 4,
      "data_type": "U4",
      "name": "iTOW",
      "unit": "ms",
      "description": "GPS time of week of the navigation epoch. See the description of iTOW for details."
    },
    {
      "byte_offset": 8,
      "data_type": "I4",
      "name": "ecefX",
      "unit": "cm",
      "description": "ECEF X coordinate"
    },
    {
      "byte_offset": 12,
      "data_type": "I4",
      "name": "ecefY",
      "unit": "cm",
      "description": "ECEF Y coordinate"
    },
    {
      "byte_offset": 16,
      "data_type": "I4",
      "name": "ecefZ",
      "unit": "cm",
      "description": "ECEF Z coordinate"
    },
    {
      "byte_offset": 20,
      "data_type": "I1",
      "name": "ecefXHp",
      "scaling": {
        "multiplier": 0.1,
        "raw": "0.1"
      },
      "unit": "mm",
      "description": "High precision component of ECEF X coordinate. Must be in the range of -99.. +99. Precise coordinate in cm = ecefX + (ecefXHp * 1e-2)."
    },
    {
      "byte_offset": 21,
      "data_type": "I1",
      "name": "ecefYHp",
      "scaling": {
        "multiplier": 0.1,
        "raw": "0.1"
      },
      "unit": "mm",
      "description": "High precision component of ECEF Y coordinate. Must be in the range of -99.. +99. Precise coordinate in cm = ecefY + (ecefYHp * 1e-2)."
    },
    {
      "byte_offset": 22,
      "data_type": "I1",
      "name": "ecefZHp",
      "scaling": {
        "multiplier": 0.1,
        "raw": "0.1"
      },
      "unit": "mm",
      "description": "High precision component of ECEF Z coordinate. Must be in the range of -99.. +99. Precise coordinate in cm = ecefZ + (ecefZHp * 1e-2)."
    },
    {
      "byte_offset": 23,
      "data_type": "X1",
      "name": "flags",
      "description": "Additional flags",
      "bitfield": [
        {
          "name": "invalidEcef",
          "mask": "0x01",
          "description": "1 = Invalid ecefX, ecefY, ecefZ, ecefXHp, ecefYHp and ecefZHp"
        }
      ]
    },
    {
      "byte_offset": 24,
      "data_type": "U4",
      "name": "pAcc",
      "scaling": {
        "multiplier": 0.1,
        "raw": "0.1"
      },
      "unit": "mm",
      "description": "Position Accuracy Estimate"
    }
  ]
}
